export default function Login({ setUser }) {
  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-r from-orange-500 to-red-500">
      <div className="bg-white p-8 rounded-xl shadow-xl w-80 text-center fade-in">
        <h2 className="text-2xl font-bold mb-6">FoodDash üçî</h2>

        <button onClick={() => setUser("nick")}
          className="w-full mb-3 bg-orange-500 text-white py-2 rounded-lg">
          Nick (Admin)
        </button>

        <button onClick={() => setUser("marvel")}
          className="w-full mb-3 bg-blue-500 text-white py-2 rounded-lg">
          Manager
        </button>

        <button onClick={() => setUser("thanos")}
          className="w-full bg-gray-700 text-white py-2 rounded-lg">
          Member
        </button>
      </div>
    </div>
  );
}
